// App icon mappings
const appIcons = {
  'Dover Portal': '🚢', // Ship icon for Dover
  'GitHub': '🐙', // Octocat icon for GitHub
  'HR Portal': '👥', // People icon for HR
  'DevOps Portal': '⚙️', // Gear icon for DevOps
  'Finance Portal': '💰', // Money bag icon for Finance
  'default': '📱' // Default icon for other apps
};

export const getAppIcon = (appName) => {
  // Find the matching icon or return default
  const icon = Object.entries(appIcons).find(([key]) => 
    appName.toLowerCase().includes(key.toLowerCase())
  );
  return icon ? icon[1] : appIcons.default;
};

export default appIcons;
